import './Presentacion.css';
import React from 'react';


export function Presentacion (){
    return <div className="EstiloPresentacion" style={{ textAlign: 'center' }}>
        <p className='EstiloTextoP'>Somos SegurosYA!, compañía de seguros líder en el mercado en la oferta de seguros deautomóviles en todo el país.Nos enorgullece ofrecer una amplia variedad de soluciones de seguro de vehículos, que cubren todos los riesgos que pueden enfrentar nuestros clientes en la carretera. Entendemos la importancia de proteger su vehículo y a sus ocupantes, y por eso nos esforzamos por brindar el mejor servicio posible a todos nuestros clientes.</p>
        <button type="button" class="btnGeneral btnPresentacion">Más productos</button>
    </div>
}
